import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App"> 
        <h2>Cadastro</h2>
        <hr />

        <label>Nome: </label>
        <input type="text" value = {this.state.nome} />
        <br />

        <label>RGA: </label>
        <input type="text" value = {this.state.rga} />
        <br />

        <input type="button" value="Submit" />

          <hr />      
      </div>
    );
  }
}

export default App;
